import React, { Component } from 'react';
import Buttons from './Buttons.js';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      activeIndex: 0
    };
  }

  details = [
    {id:'home', label:'Home'},
    {id:'about', label:'About'},
    {id:'projects', label:'Projects'},
  ]

  render() {
    return (
      <React.Fragment>
        <div className='main'>
          <Buttons />
        </div>
      </React.Fragment>
    );
  }
}


export default App;
